import React, { Component } from 'react'
import Ts1 from './components/Ts1';
export default class App extends Component {
  render() {
    let personne1={nom:"Rami",age:20}
    let personne2={nom:"Kamali",age:25}
     let personne3={nom:"Fahmi",age:40}
    return (
      <div className='App'>
          <Ts1 n={personne1} age={personne1}/>
          <Ts1 nom={personne2} age={personne2}/>
          <Ts1 nom={personne3} age={personne3}/>
      </div>
    )
  }
}
